###################################################
# Classes providing decorators that create executable chain of functions
###################################################


class GlueStepsTogether(object):
	"""
	Chains execution of functions and provides a shared object.

	The class is instantiated with a [reference to] a shared object.
	The resulting instance is then used as a decorator on functions
	that take exactly one argument - the shared object.
	The order of decorator application is remembered in the instance.
	Calling any resulting decorated function results in this function
	and all subsequent functions being called in the order.
	The chain can be executed from start by calling the first decorated
	function or by calling the start() method of the instance.
	"""
	def __init__(self, shared_obj):
		"""
		The shared_obj value is provided to all decorated functions as an argument.
		"""
		def nop():
			pass
		self.chain = []
		self.sobj = shared_obj
		self.nop = nop
	def __call__(self, f):
		"""
		Use the class instance as a decorator. (Or use f = instance(f).)
		"""
		glue_instance = self
		chain_pos = len(self.chain)
		def decorated():
			f(glue_instance.sobj)
			next_f = glue_instance.chain[chain_pos + 1] if (len(glue_instance.chain) > (chain_pos + 1)) else glue_instance.nop
			next_f()
		self.chain.append(decorated)
		return decorated
	def start(self):
		"""
		Executes the entire chain of decorated functions in the order of decoration.
		"""
		self.chain[0]()	

class GlueStepsTogetherOrdered(object):
	"""
	Chains execution of functions and provides a shared object.

	The class is instantiated with a [reference to] a shared object.
	The resulting instance is then used as a decorator on functions
	that take exactly one argument - the shared object.
	The decorator has to be called like this: @glue("mg").
	The string in the argument specifies the order - all decorated 
	functions are ordered by the specified string, so e.g.
	"ma" is before "mg", etc.
	For the record, this is how Python sorts:
	['Mb', 'a', 'ak', 'ma', 'maa', 'mg', 'v', 'vvv']
	Calling any resulting decorated function results in this function
	and all subsequent functions being called in the order.
	The chain can be executed from start by calling the first decorated
	function or by calling the start() method of the instance.
	"""
	def __init__(self, shared_obj):
		"""
		The shared_obj value is provided to all decorated functions as an argument.
		"""
		def nop():
			pass
		self.chain = {}
		self.sobj = shared_obj
		self.nop = nop
	def __call__(self, order_str):
		"""
		Use the class instance with one argument (string that controls the position) as a decorator. (Or use f = instance("aab")(f).)

		All the used strings are sorted and the decorated functions are then called in the order of the sorted strings.
		"""
		if order_str in self.chain:
			raise ValueError("Order string {} already exists".format(order_str))
		def decorator(f):
			chain_pos = len(self.chain)
			def decorated():
				# run the decorated function
				f(self.sobj)

				# find the next function and run it
				sorted_keys = list(self.chain.keys()) # deep copy
				sorted_keys.sort()
				pos_of_curr_fun = sorted_keys.index(order_str)
				if len(sorted_keys) > (pos_of_curr_fun + 1):
					next_fun_key = sorted_keys[pos_of_curr_fun+1]
					next_fun = self.chain[next_fun_key]
					next_fun()
			self.chain[order_str] = decorated
			return decorated
		return decorator
	def start(self):
		"""
		Executes the entire chain of decorated functions in the order of decoration.
		"""
		# find the next function and run it
		sorted_keys = list(self.chain.keys()) # deep copy
		sorted_keys.sort()
		if len(sorted_keys) > 0:
			self.chain[sorted_keys[0]]()
		else:
			# TODO raise exception
			print("TODO exception asdffffdfdfd")


