def patchGlueStepsTogetherOrdered(instance):
	"""
	Replaces the start() method with a new method that replaces the instance with a function. Used for a part of the awful obfuscation.
	"""
	def start_(self):
		"""
		Replaces the execution chain with empty functions (so that executing one function doesn't execute the rest of the chain). Replaces the __call__() method so that it no longer functions as a decorator and instead repeated executions of the function (!) execute the functions from the chain, one at a time. It effectively replaces the whole instance of the class with the new function. Replacing works only in globals().
		"""
		self.chain_keys = sorted(self.chain.keys())
		self.chain_copy = dict(self.chain) # shallow copy
		chain_values_nop = [self.nop] * len(self.chain_keys)
		self.chain = dict(zip(self.chain_keys, chain_values_nop)) # new dict that points only to nop functions so that the decorated functions don't execute the rest of the chain
		self.last_called_fun = -1
		def call_():
			"""run the next function from the chain if there are functions left"""
			if self.last_called_fun + 1 < len(self.chain_keys):
				self.last_called_fun += 1
				self.chain_copy[self.chain_keys[self.last_called_fun]]()
		inst = hex(id(self))
		for key, value in globals().items():
			if inst in repr(value):
				globals()[key] = call_ # aww yeah that's nasty, there's just a function (not method! not bound) behind the name of what was formerly an instance; and the instance is now hidden as a reference in the captured locals of the function
				
		# TODO why doesn't __call__ work?
		#self.__call__ = types.MethodType(call_, self, GlueStepsTogetherOrdered)
		#self.call = types.MethodType(call_, self, GlueStepsTogetherOrdered)
		#self.__call__ = call_.__get__(self, GlueStepsTogetherOrdered)
		# self.__call__ = call_ # it no longer behaves as a decorator

	instance.start = types.MethodType(start_, instance, GlueStepsTogetherOrdered)



