# Extension to the zipfile module
###################################################

def writegen(self, zinfo_or_arcname, bytegen, compress_type=None):
	"""Write an iterable (preferably a string generator) into the archive.
	'zinfo_or_arcname' is either a ZipInfo instance or
	the name of the file in the archive.
	Based on code from the methods write() and writestr() from
	https://hg.python.org/cpython/file/2.7/Lib/zipfile.py
	LICENSE:
	Changes made by Jakub Svoboda in 2015. I hereby license the code
	under the same license(s) the original referenced sources
	are licensed under, so that the licensing terms of the original
	referenced code are not broken by me.
	You can use the code as though properly licensed under the license(s)
	listed at https://www.python.org/download/releases/2.7/license/
	"""
	if not isinstance(zinfo_or_arcname, zipfile.ZipInfo):
		zinfo = zipfile.ZipInfo(filename=zinfo_or_arcname,
						date_time=time.localtime(time.time())[:6])

		zinfo.compress_type = self.compression
		if zinfo.filename[-1] == '/':
			zinfo.external_attr = 0o40775 << 16   # drwxrwxr-x
			zinfo.external_attr |= 0x10		   # MS-DOS directory flag
		else:
			zinfo.external_attr = 0o600 << 16	 # ?rw-------
	else:
		zinfo = zinfo_or_arcname

	if not self.fp:
		raise RuntimeError(
			  "Attempt to write to ZIP archive that was already closed")

	if compress_type is not None:
		zinfo.compress_type = compress_type

	zinfo.file_size = 0			# Uncompressed size
	zinfo.header_offset = self.fp.tell()	# Start of header bytes
	self._writecheck(zinfo)
	self._didModify = True

	zinfo.CRC = CRC = 0
	zinfo.compress_size = compress_size = 0
	# Compressed size can be larger than uncompressed size

	zip64 = self._allowZip64 and \
			zinfo.file_size * 1.05 > ZIP64_LIMIT
	self.fp.write(zinfo.FileHeader(zip64))
	if zinfo.compress_type == zipfile.ZIP_DEFLATED:
		cmpr = zlib.compressobj(zlib.Z_DEFAULT_COMPRESSION,
			 zlib.DEFLATED, -15)
	else:
		cmpr = None
	file_size = 0
	for genline in bytegen:
		buf = genline

		file_size = file_size + len(buf)
		CRC = zlib.crc32(buf, CRC) & 0xffffffff
		if cmpr:
			buf = cmpr.compress(buf)
			compress_size = compress_size + len(buf)
		self.fp.write(buf)


	if cmpr:
		buf = cmpr.flush()
		compress_size = compress_size + len(buf)
		self.fp.write(buf)
		zinfo.compress_size = compress_size
	else:
		zinfo.compress_size = file_size
	zinfo.CRC = CRC
	zinfo.file_size = file_size
	if not zip64 and self._allowZip64:
		if file_size > ZIP64_LIMIT:
			raise RuntimeError('File size has increased during compressing')
		if compress_size > ZIP64_LIMIT:
			raise RuntimeError('Compressed size larger than uncompressed size')

	# Seek backwards and write file header (which will now include
	# correct CRC and file sizes)
	position = self.fp.tell()	   # Preserve current position in file
	self.fp.seek(zinfo.header_offset, 0)
	self.fp.write(zinfo.FileHeader(zip64))
	self.fp.seek(position, 0)
	self.filelist.append(zinfo)
	self.NameToInfo[zinfo.filename] = zinfo


# add the new method to the class
zipfile.ZipFile.writegen = writegen



